import React from "react";
import logo from "../assets/Logo.svg";

const Nav = () => {
  return (
    <>
      <img src={logo} alt="Little Lemon" />
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Menu</a>
        </li>
        <li>
          <a href="#">Reservation</a>
        </li>
        <li>
          <a href="#">Order Online</a>
        </li>
        <li>
          <a>Login</a>
        </li>
      </ul>
    </>
  );
};

export default Nav;
